import React, { useState } from 'react';
import { View, Image, ImageBackground, StyleSheet, Text, TextInput } from 'react-native';
import { Feather as Icon } from '@expo/vector-icons';
import { RectButton } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import { Ionicons } from "react-native-vector-icons";

import styles from './estilo';

export default function tPerfilBaba({ route }) {
    
    const { usuario } = route.params;
    const navigation = useNavigation();

    function Voltar() {
        navigation.goBack()
    }

    return (
        <View style={styles.container}>
            <Ionicons
                name="chevron-back"
                size={40}
                color="black"
                onPress={Voltar}    
            />
            <Text style={styles.title}>Página de Detalhes</Text>

            <Image source={{ uri: usuario.imagem }} style={styles.imagem} />
            <Text>{usuario.nome}</Text>
            <Text>{usuario.email}</Text>
            <Text>{usuario.celular}</Text>
            <Text>{usuario.descricao}</Text>
            
        </View>
    );
}
